import { Link } from 'react-router-dom';
import './style/team.css'

function Team ({ team }) {
  return (
    <Link className='team' to="/info" state={{ team }}>
      <img  src={team.logo} alt="League logo"/>
      <h2 className='name'>{team.name}</h2>
      <p className='city'>{team.city}</p>
    </Link>
  );
}

export default Team;
